import React from 'react';
import './Section.css';

function Dogs() {
  return (
    <div className="section dogs">
      <h2>Dogs</h2>
      <p>Your Perfect Buddies!</p>
      <p>
        Discover a wide range of supplies for your canine friends. From nutritious food to comfortable bedding and fun toys, we have everything you need to keep your dog happy and healthy.
      </p>
      <button>Shop Now</button>
    </div>
  );
}

export default Dogs;
